import React from 'react';
import tour from '../../assets/tourEiffel.jpg';
import Felix from '../../assets/FélixRecad.jpg';

const Presentation = () => {
  return (
    <div>
        <div>
            <img src={Felix} alt="photo Felix" className=''/>
        </div>
        <div>
            <img src={tour} alt="tour Eiffel" className=''/>
        </div>
    </div>
  )
}

export default Presentation;
